    function G2=map_gamma2(MAP)
    % function G2=map_gamma2(MAP)
    %   
    %   Input:  
    %       MAP = a map in the form of {D0,D1}
    %
    %   Output: 
    %       G2  = rou(i) / rou(i-1), where rou(i) represents the i-th
    %       autocorrelations of interarrival times of the given map
    %
    %   Comments:
    %       In a map, the ratio of two consecutive autocorrelations is always
    %       the same

        if issym(MAP{1}(1,1))
            % if map is symbolic
            P=inv(-MAP{1})*MAP{2};
            g=simplify(eig(P));
            if g(1)==1
                G2=g(2);
            else
                G2=g(1);
            end
        else
            G2=at(sort(eig(inv(-MAP{1})*MAP{2}),'descend'),2);
        end
    end

    function b=issym(x)
        b=strcmpi(class(x),'sym');
    end
    
    function [a]=at(A,r,i)
    a=A(r);
    if nargin==3
        a=A(r,i);
    end
